import React from "react";
import "../styles/Profile.css";

const Profile = () => {
  return (
    <section id="sec_1">
      <div>
        <h3>EMMMANUEL MEFOR</h3>

        <h4>Web Developer</h4>

        <p>
          My name is Emmanuel Mefor, I am currently learning coding at Bethel
          Tech.
        </p>
        <button type="button" class="btn btn-outline-primary ms-1">
          Message
        </button>
      </div>
    </section>
  );
};

export default Profile;
